import { Divider, Stack, Typography } from "@mui/joy";

export default function UserInformationCard() {
  return (
    <Stack direction="row" sx={{ backgroundColor: "red", p: 10 }}>
      <Stack direction="row" spacing={1}>
        <Typography>About Me</Typography>
        <Divider sx={{border:1}}/>
      </Stack>
    </Stack>
  );
}
